"use client"
import { useTheme } from "next-themes";

export const Character = ({ className }: { className: string }) => {
  const { theme, systemTheme } = useTheme();

  if (theme === 'dark' || (theme === 'system' && systemTheme === 'dark')) {
    return <DarkCharacter className={className} />;
  } else {
    return <LightCharacter className={className} />;
  }
};


